import Typed from "typed.js";

export default function heroLogic() {
  const whatAmIStrings = ["nait graduate", "coder", "dungeon master", "cat mom", "coffee addict"];
  const typedOptions = {
    strings: "strings",
    typeSpeed: 50,
    backSpeed: 50,
  };
  const myTyped = new Typed(".hero-h1-dynamic-text", whatAmIStrings, typedOptions);
}
